<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Medical Infographic Viewer</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@100..900&family=Outfit:wght@100..900&display=swap" rel="stylesheet">
    <style>
        /* Custom CSS for enhanced aesthetics */
        body {
            background-color: #121212; /* Deep, sophisticated dark background */
            color: #e0e0e0; /* Light grey for text, ensuring high contrast */
            font-family: 'Inter', sans-serif; /* Primary body font for readability */
            display: flex;
            justify-content: center;
            align-items: flex-start; /* Align items to the top, to avoid stretching if content is short */
            min-height: 100vh;
            padding: 2rem 1rem; /* Add padding for better spacing on smaller screens */
            overflow-x: hidden; /* Prevent horizontal scrollbar */
        }

        /* Tailwind Configuration Extension */
        .dark {
            background-color: #121212;
            color: #e0e0e0;
        }

        .container {
            width: 100%;
            max-width: 1200px; /* Max width for large screens */
            background: linear-gradient(135deg, rgba(255,255,255,0.05) 0%, rgba(255,255,255,0.1) 100%); /* Subtle glassmorphism effect */
            border-radius: 1rem; /* Rounded corners */
            box-shadow: 0 8px 32px 0 rgba(31, 38, 135, 0.37),
                        0 4px 16px 0 rgba(31, 38, 135, 0.37); /* Nebula-like glow effect */
            backdrop-filter: blur(7px);
            -webkit-backdrop-filter: blur(7px);
            border: 1px solid rgba(255, 255, 255, 0.18); /* Frosty glass border */
            padding: 2rem;
            text-align: center;
            position: relative; /* For potential pseudo-elements or absolute positioning */
        }

        .title {
            font-family: 'Outfit', sans-serif; /* Distinct display font for titles */
            font-size: 2.5rem; /* Larger font size for titles */
            font-weight: 700; /* Bold */
            color: #ffffff; /* White for emphasis */
            margin-bottom: 2rem;
            letter-spacing: -0.025em; /* Slight letter spacing adjustment */
            text-shadow: 0 0 10px rgba(100, 181, 246, 0.5); /* Subtle glow */
        }

        .infographic-wrapper {
            position: relative;
            border-radius: 0.75rem; /* Rounded corners for the image container */
            overflow: hidden; /* Ensures image stays within rounded corners */
            box-shadow: 0 0 20px rgba(0,0,0,0.3); /* Soft shadow for depth */
            transition: transform 0.3s ease-in-out, box-shadow 0.3s ease-in-out;
        }

        .infographic-wrapper img {
            display: block; /* Remove extra space below image */
            width: 100%;
            height: auto; /* Maintain aspect ratio */
            border-radius: 0.75rem; /* Match wrapper radius */
        }

        .infographic-wrapper:hover {
            transform: translateY(-5px) scale(1.01); /* Subtle zoom effect on hover */
            box-shadow: 0 15px 30px rgba(0,0,0,0.5); /* Enhanced shadow on hover */
        }

        /* Responsive adjustments */
        @media (max-width: 768px) {
            .title {
                font-size: 2rem;
                margin-bottom: 1.5rem;
            }
            .container {
                padding: 1.5rem;
            }
        }
        
        @media (max-width: 480px) {
            .title {
                font-size: 1.75rem;
            }
            .container {
                padding: 1rem;
            }
        }
    </style>
</head>
